import React from "react";
import { Navbar } from "react-bootstrap";
import ModalForm from "./ModalForm";

const Header = () => {
  return (
    <div>
      <Navbar color="blue">
        <Navbar.Brand href="#home">Accueil</Navbar.Brand>
        <ModalForm />
      </Navbar>
    </div>
  );
};
export default Header;
